import React from 'react';
import { Link } from 'react-router-dom';
import '../index.scss';

const items = [{
  path: '/',
  text: 'work.'
}, {
  path: '/about',
  text: 'about'
}];

export default function Nav() {
    return (
      <div className="container-fluid">
        <div className="row middle-xs navbar">
          <div className="col-xs-6 start-xs">
            <Link to="/" className="navbar-logo">stphnhthwy.</Link>
          </div>
          <ul className="col-xs-6 end-xs navbar-list">
              <li className="navbar-list-items"><Link to="/" className="navbar-link">work.</Link></li>
              <li className="navbar-list-items"><Link to="/about" className="navbar-link">about.</Link></li>
          </ul>
        </div>
      </div>
    );
}
